import './App.css';
import { useState } from 'react';
import Swal from 'sweetalert2';
import Axios from 'axios';
import { ChakraProvider } from '@chakra-ui/react';
import { Button } from '@chakra-ui/react';
import { ArrowForwardIcon  } from "react-icons/md"

function App() {
  const [name, setName] = useState("");
  const [age, setAge] = useState(0);
  const [city, setCity] = useState("");
  const [charge, setCharge] = useState("");
  const [years, setYears] = useState(0);

  const [employeesList, setEmployeesList] = useState([]);

  const handleSubmit = async () => {
    if (!name || !city || !charge || age <= 0 || years < 0) {
      Swal.fire({
        title: 'Error',
        text: 'Please fill out all fields correctly.',
        icon: 'error',
        confirmButtonText: 'OK'
      });
      return;
    }

    try {
      const response = await Axios.post('http://localhost:3001/create', {
        name,
        age,
        city,
        charge,
        years
      });

      if (response.data.success) {
        Swal.fire({
          title: 'Success',
          text: response.data.message,
          icon: 'success',
          confirmButtonText: 'OK'
        });

        // Fetch the updated list of employees
        getEmployees();
      } else {
        Swal.fire({
          title: 'Error',
          text: response.data.message,
          icon: 'error',
          confirmButtonText: 'OK'
        });
      }
    } catch (error) {
      Swal.fire({
        title: 'Error',
        text: 'Failed to register user. Please try again later.',
        icon: 'error',
        confirmButtonText: 'OK'
      });
      console.error('Error during user registration:', error);
    }
  };

  const getEmployees = async () => {
    try {
      const response = await Axios.get('http://localhost:3001/employees');
      setEmployeesList(response.data);
    } catch (error) {
      console.error('Error fetching employees:', error);
      Swal.fire({
        title: 'Error',
        text: 'Failed to fetch employees. Please try again later.',
        icon: 'error',
        confirmButtonText: 'OK'
      });
    }
  };

  return (
    <ChakraProvider>
    <div className="App">
      <div className="data-form">
        <label>
          Name:
          <input
            onChange={(event) => setName(event.target.value)}
            type="text"
            value={name}
          />
        </label>

        <label>
          Age:
          <input
            onChange={(event) => setAge(parseInt(event.target.value, 10) || 0)}
            type="number"
            value={age}
          />
        </label>

        <label>
          City:
          <input
            onChange={(event) => setCity(event.target.value)}
            type="text"
            value={city}
          />
        </label>

        <label>
          Charge:
          <input
            onChange={(event) => setCharge(event.target.value)}
            type="text"
            value={charge}
          />
        </label>

        <label>
          Years:
          <input
            onChange={(event) => setYears(parseInt(event.target.value, 10) || 0)}
            type="number"
            value={years}
          />
        </label>

        <Button rightIcon={<ArrowForwardIcon />} colorScheme='blue' size="lg" className='buttonList' onClick={handleSubmit}>Insert</Button>
      </div>
      <br/>
      <div className="list">
        <button onClick={getEmployees}>Show Employees</button>
        {employeesList.length > 0 ? (
          employeesList.map((employee, index) => (
            <div className='listEmployee' key={index}>
              <div className='spacing'>{employee.name}</div>
              <div className='spacing'>{employee.age}</div>
              <div className='spacing'>{employee.city}</div>
              <div className='spacing'>{employee.charge}</div>
              <div className='spacing'>{employee.years}</div>
              <div className='spacing'> {employee.dateRegister.slice(0, -14)} </div>
            </div>

          ))
        ) : (
          <div>No employees found</div>
        )}
      </div>
    </div>
    </ChakraProvider>
  );
}

export default App;
